import { gql } from "apollo-boost";

export const REGISTER = gql`
  mutation register(
    $username: String!
    $email: String!
    $password: String!
    $phone: String!
    $type: String!
  ) {
    register(data: {
      username: $username
      email: $email
      password: $password
      phone: $phone
      type: $type
      }
    ) {
      username
      email
      password
      phone
      type

    }
    }
  }
`;
